import React, {Component} from 'react'
import {
    Button,
    Form
  //   NavbarText
  } from 'reactstrap';
  import NotesBody from '../components/NotesBody'
  import AssistsBody from '../components/AssistsBody'
import '../components/styles/inicio.css'


class Inicio extends React.Component {

    constructor(props) {
        super(props);
        this.state = {value: ''};
    
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }
    
      handleChange(event) {
        this.setState({value: event.target.value});
      }
    
      handleSubmit(event) {
        alert('A name was submitted: ' + this.state.value);
        event.preventDefault();
      }

    render(){
        const local = localStorage.getItem('logueado')
    return (
        <div>
            {local ?
                <div className="row">
                <div className="col-12 col-sm-12 col-md-3 justify-content-start">
                <NotesBody />
                </div>
                <div className="col-12 col-sm-12 col-md-9">
                <AssistsBody/>
                </div>
                </div>
                :
                <div className="col-12 full-login">
                    <div className="todo-center bg-dark">
                        <p className="text-center text-white">Porfavor, coloca tu nombre.</p> 

                        
      <Form onSubmit={this.handleSubmit}>

        <Form.Group controlId="formBasicEmail">
            <Form.Label>Nombre</Form.Label>
                 <Form.Control type="text" placeholder="Ingresar nombre..." value={this.state.value} onChange={this.handleChange} />
                        <Form.Text className="text-muted">
                                  No compartiremos esta informaci√≥n con nadie.
                        </Form.Text>
        </Form.Group>
                        <Button variant="primary" type="submit" value="Submit">
                                      Submit
                        </Button>
        </Form>
                    </div>
                </div>
                }
        </div>
    )
}

}
export default Inicio
